import React, {Component} from 'react';
import Menu from '../components/Menu';

class MainTemplate extends Component {
    render() {
        return (
            <div>
                <Menu />
                <div>
                    {this.props.children}
                </div>
                <div>
                    <hr/>
                    This is footer
                </div>

                <style global jsx> {`
                    h1: red;
                `}</style>

            </div>
        );
    }
}

export default MainTemplate;
